description:
Adult's most awarded director, Paul Thomas, brings together Malibu, Meggan, threeways and facials, in Meggan Does Malibu, a story about sand, sun, sex and second chances. It's a tale told as old as the sea, and told only as Paul Thomas can...from the people who do sex and story best...Vivid.

